import React from 'react';
import ReactDOM from 'react-dom';

import './App.css';
import "./sidebar.css";
import SideBar from "./sidebar";
import logo from './assets/fusion_logo.png';
import styles from './styles.scss'
import NewsHeaderCard from '../node_modules/react-ui-cards';


function App() {
    return (
        <div id="App">

            <SideBar pageWrapId={"page-wrap"} outerContainerId={"App"} />



            <div id="page-wrap">
                <h1>conFUSION</h1>
            </div>
        <h2>
        News headers cards
        </h2>
    <div className={styles.links}>
        <a href='https://www.npmjs.com/package/react-ui-cards'>npm</a> |
        <a href='https://github.com/nukeop/react-ui-cards'>Github</a>
        </div>


            <header className="App-header">
                <img src={logo} className="App-logo" alt="logo" />
            </header>






    </div>
);
}




export default App;
